import React, { Component } from "react";
import Slider from "react-slick";

export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: false,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
    };
    return (
      <div>
        <Slider {...settings}>
            <div>
          <img src="./argile.jpg" alt="image 1" />
          <img src="./huile-nuit.jpg" alt="image 2" />
          <img src="image3.jpg" alt="image 3" />
          </div>
        </Slider>
      </div>
    );
  }
}
